import axios from "axios";

export default function() {
    const [records, setRecords] = React.useState([]);

    const SetR = async () => {
        const rec = await axios({
            "method":"GET",
            "url":"https://corona.lmao.ninja/countries",
            "params":{
            "sort":"cases"
            }
            })
        .then((response)=>{
            const Timeline = response.data;
            return Timeline;
        })
        .catch((error)=>{
            console.log(error)
    });
    setRecords(rec);
   }

    SetR();
    return records;
}
